  color: #e1e9fc;
  justify-content: space-between;
  align-items: center;
  list-style: none;
  text-decoration: none;
  font-size: 16px;
  margin-left: 0%;
  margin-top: 0.5ch;
  margin-bottom: 1ch;
  margin-right: 1ch;
  height:35px;


  &:hover {
    background: #252831;
    border-left: 4px solid green;
    cursor: pointer;
  }
`;

const SidebarLabel = styled.span`
`;

